export default function ButtonAddTailwind({ onClick, isButton, title }) {
  return (
    isButton && (
      <button
        onClick={onClick}
        className={
          "bg-blue-700 border-2 font-bold text-gray-200 px-4 py-2 lg:absolute lg:top-40 lg:right-20 rounded-2xl sm:ml-5 "
        }
      >
        {title}
      </button>
    )
  );
}
